import Faq from "../component/Faq";
import Footer from "../component/Footer";

function Home() {
  

  return (
    <>
      <section className="video-place position-relative">
        <section>
          <video
            src="\video\19598792-hd_1080_1920_30fps.mp4"
            autoPlay
            loop
            muted
          />
        </section>

        <section className="video-sec position-absolute">
          <Frontslide />
        </section>
      </section>
      
      <Albums />

      <Worklist />

      <Testimonal />

      <Faq/>

      <Footer/>
    </>
  );
}

export default Home;
